import React from 'react';

const Marker = ({ name, coordinates, onClick, active} ) => (
	<div onClick={onClick} 
		 style={{backgroundColor: active ? 'red' : 'none' }}
	>
		{name}<br/>
		{coordinates}
	</div>
)

export default Marker
